(window.webpackJsonp=window.webpackJsonp||[]).push([[9],{"16l3":function(A,e,n){"use strict";n.r(e),n.d(e,"default",(function(){return o}));var a=n("AIc5"),t=n("q1tI"),i=n.n(t),s=n("Bl7J"),r=n("RTHJ"),g=n.n(r);function o(){var A=a.data;return i.a.createElement(s.a,null,i.a.createElement("h1",null,"Meine Projekte"),i.a.createElement("p",null,"Hier ist eine kleine Auswahl meiner etwas umfangreicheren Projekte, bei denen ich sowohl die Planung für gutes UX-Design und auch die Erstellung der Website erfolgreich abschließen konnte."),i.a.createElement("ol",null,A.allMarkdownRemark.edges.map((function(A){return i.a.createElement("li",{className:g.a.projects},i.a.createElement("h3",null,A.node.frontmatter.title),i.a.createElement("div",{dangerouslySetInnerHTML:{__html:A.node.html}}))}))))}},AIc5:function(A){A.exports=JSON.parse('{"data":{"allMarkdownRemark":{"edges":[{"node":{"frontmatter":{"title":"Eigene Website"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto; max-width: 800px; \\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 50%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"Meine alte Website\\"\\n        title=\\"Meine alte Website\\"\\n        src=\\"/static/2995b65be652327013e615fb34c10578/4b190/WebDevDesign_Website.jpg\\"\\n        srcset=\\"/static/2995b65be652327013e615fb34c10578/e07e9/WebDevDesign_Website.jpg 200w,\\n/static/2995b65be652327013e615fb34c10578/066f9/WebDevDesign_Website.jpg 400w,\\n/static/2995b65be652327013e615fb34c10578/4b190/WebDevDesign_Website.jpg 800w,\\n/static/2995b65be652327013e615fb34c10578/a2510/WebDevDesign_Website.jpg 1000w\\"\\n        sizes=\\"(max-width: 800px) 100vw, 800px\\"\\n        style=\\"width:100%;height:100%;margin:0;vertical-align:middle;position:absolute;top:0;left:0;\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<p>Das ist meine alte Website, von Anfang an habe ich an dieser geübt, programmiert, verworfen und immer wieder neu hochgezogen oder erneuert. Aber sie hatte leider keine https-Verschlüsselung und als uralte Inklusivdomain zu meinem alten Vertrag, wollte man sie auch nicht einfach so umschalten - jetzt wird sie durch eine mit modernerer Codetechnologie ersetzt, an der ich ab sofort weiter programmieren und lernen werde.</p>\\n<p>Die Seite wurde von mir zu Anfang in HTML, CSS und JQuery erstellt, nach einiger Zeit und mehr Erfahrung stellte ich die Codestuktur auf das modernere HTML5, CSS3 um und JQuery wurde reines JavaScript ersetzt - auch Animationen wurden dort an einigen Stellen eingebracht und der Parallax-Effekt durfte auch nicht fehlen.</p>\\n<div style=\\"text-align: right\\">Techstack: HTML5 | CSS3 | JavaScript</div>"}},{"node":{"frontmatter":{"title":"Neustart als Tagesmutter"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto; max-width: 800px; \\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 50%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"Website Kita Löwenzahn\\"\\n        title=\\"Website Kita Löwenzahn\\"\\n        src=\\"/static/c76b66e89210780dd18812ce9788ed3d/4b190/Website_Kita_Loew_web1.jpg\\"\\n        srcset=\\"/static/c76b66e89210780dd18812ce9788ed3d/e07e9/Website_Kita_Loew_web1.jpg 200w,\\n/static/c76b66e89210780dd18812ce9788ed3d/066f9/Website_Kita_Loew_web1.jpg 400w,\\n/static/c76b66e89210780dd18812ce9788ed3d/4b190/Website_Kita_Loew_web1.jpg 800w,\\n/static/c76b66e89210780dd18812ce9788ed3d/a2510/Website_Kita_Loew_web1.jpg 1000w\\"\\n        sizes=\\"(max-width: 800px) 100vw, 800px\\"\\n        style=\\"width:100%;height:100%;margin:0;vertical-align:middle;position:absolute;top:0;left:0;\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<p><strong>Eine gelernte Erzieherin wollte sich möglichst schnell in der Region als die Fachkraft zeigen und etablieren - das war die Ausgangssituation für ihren »Neustart«.</strong></p>\\n<p>Die anfängliche <strong>User-Research</strong> und Konkurrenzanalyse zeigte mir, dass man mit Informationen auf der gewünschten Website, nach denen Eltern häufig suchen, sich gut abheben kann. Zudem wurden kleinere Animationen und ein buntes, abgestimmtes <strong>Farbkonzept</strong> als Blickfang eingeplant, es sollten auch alle wichtigen Infos für die Eltern sofort sichtbar sein, Termine und Aktionen sollten selber aktualisiert werden können. Auch der Hinweis auf die staatl. Prüfung durfte nicht fehlen, denn das war ihr <strong>Alleinstellungsmerkmal</strong> gegenüber den anderen Tagesmüttern.</p>\\n<p>Das Logo für die Kita wurde zuerst digital gezeichnet, aber auch schnell <strong>wieder verworfen</strong> - Pixelgrafiken sehen zwar authentischer aus, lassen sich aber nicht wie Vektorgrafiken skalieren. Auch der Hauptteil der Seite verlief ursprünglich gerade senkrecht durch die Seite, das haben allerdings schon viele und deswegen wurde der Hauptbereich leicht angewinkelt und eingezogen, um ihm das Aussehen eines Blatt Papieres zu geben. In diesem Zuge wanderte das Menü nach oben neben das Logo, das sind die meisten User gewohnt und <strong>kommen damit schneller im hektischen Alltag mit den Kindern klar.</strong></p>\\n<p>Das kinderfreundliche Gesamtbild, die wichtigsten Informationen auf einen Blick, das Kontaktformular und gute <strong>SEO</strong> brachten der Seite bis heute <strong>beste Präsenz und Resonanz</strong> in der lokalen Region, bei suchenden Müttern und auch im Google-Ranking.</p>\\n<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto; max-width: 800px; \\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 50%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"Logovergleich Kita Löwenzahn\\"\\n        title=\\"Logovergleich Kita Löwenzahn\\"\\n        src=\\"/static/72434937dbaa4de9c95938f4ce7abfaa/4b190/Loew_logovergleich.jpg\\"\\n        srcset=\\"/static/72434937dbaa4de9c95938f4ce7abfaa/e07e9/Loew_logovergleich.jpg 200w,\\n/static/72434937dbaa4de9c95938f4ce7abfaa/066f9/Loew_logovergleich.jpg 400w,\\n/static/72434937dbaa4de9c95938f4ce7abfaa/4b190/Loew_logovergleich.jpg 800w,\\n/static/72434937dbaa4de9c95938f4ce7abfaa/d7ad1/Loew_logovergleich.jpg 1001w\\"\\n        sizes=\\"(max-width: 800px) 100vw, 800px\\"\\n        style=\\"width:100%;height:100%;margin:0;vertical-align:middle;position:absolute;top:0;left:0;\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<p>Das ursprüngliche Logo (li.) wurde zugunsten des flexibleren Vektorlogos wieder verworfen.</p>\\n<div style=\\"text-align: right\\">Techstack: UX | Joomla! | HTML5 | CSS3</div>"}},{"node":{"frontmatter":{"title":"Mehr Spendengelder für guten Zweck"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto; max-width: 800px; \\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 50%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"Website Moorland-Festival\\"\\n        title=\\"Website Moorland-Festival\\"\\n        src=\\"/static/61f97020639e470ed1ee217a568980fa/4b190/MoorlandFestivalWebsite1.jpg\\"\\n        srcset=\\"/static/61f97020639e470ed1ee217a568980fa/e07e9/MoorlandFestivalWebsite1.jpg 200w,\\n/static/61f97020639e470ed1ee217a568980fa/066f9/MoorlandFestivalWebsite1.jpg 400w,\\n/static/61f97020639e470ed1ee217a568980fa/4b190/MoorlandFestivalWebsite1.jpg 800w,\\n/static/61f97020639e470ed1ee217a568980fa/a2510/MoorlandFestivalWebsite1.jpg 1000w\\"\\n        sizes=\\"(max-width: 800px) 100vw, 800px\\"\\n        style=\\"width:100%;height:100%;margin:0;vertical-align:middle;position:absolute;top:0;left:0;\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<p><strong>Für das zweite Moorland-Festival sollten noch mehr Spendengelder für einem guten Zweck durch Besucher zusammenkommen und Risiken sollte zudem vermindert werden.</strong></p>\\n<p>Die User-Research und Ist-Analyse brachte einiges zum Vorschein: Viel Arbeit und fachliches Know-how wurde gebraucht. Damit auf allen Kanälen die Kommunikation und Werbung flüssig und eingängig funktioniert, musste eine programmatisch <strong>modernere Website</strong> und <strong>flexiblere Farbkomposition-/harmonie</strong> her, auch das stark pixelige <strong>Logo musste modernisiert</strong> werden.</p>\\n<p>Da das ursprüngliche Schwarz zu dominant dem Gelb/Orange war, wurde es etwas zurückgenommen und neu angemischt und ein warmes Grau kam dazu, damit hatte man <strong>genug Farben</strong> zur Verfügung und war <strong>flexibel.</strong> Das Logo habe ich vektorisiert und neu zugerichtet, die Website brauchte kein CMS und »kostspielige« Module, da sie von mir für die Zeit gepflegt wurde.</p>\\n<p>Die frühzeitig bekannte Website, die Printwerbung, das <strong>einheitliche CI</strong> und vor allem die auftretenden Bands machten einen so soliden, rockigen und zugleich professionelleren Eindruck, dass sich die <strong>Spendengelder verdoppelt</strong> hatten. Auch die Berichterstattung in den Medien war durchweg positiv.\\n<strong>10.000 € kamen für einen guten Zweck zusammen - wahnsinn!</strong></p>\\n<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto; max-width: 800px; \\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 50%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"Logovergleich Moorland-Festival\\"\\n        title=\\"Logovergleich Moorland-Festival\\"\\n        src=\\"/static/f1c17c759ca890be43153d9d8c4ca180/4b190/Moorland_logovergleich.jpg\\"\\n        srcset=\\"/static/f1c17c759ca890be43153d9d8c4ca180/e07e9/Moorland_logovergleich.jpg 200w,\\n/static/f1c17c759ca890be43153d9d8c4ca180/066f9/Moorland_logovergleich.jpg 400w,\\n/static/f1c17c759ca890be43153d9d8c4ca180/4b190/Moorland_logovergleich.jpg 800w,\\n/static/f1c17c759ca890be43153d9d8c4ca180/a2510/Moorland_logovergleich.jpg 1000w\\"\\n        sizes=\\"(max-width: 800px) 100vw, 800px\\"\\n        style=\\"width:100%;height:100%;margin:0;vertical-align:middle;position:absolute;top:0;left:0;\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<p>Links das alte Konzept welches für diese Herausforderung zu unflexibel war, rechts das neue mit neuer Zurichtung der Buchstaben.</p>\\n<div style=\\"text-align: right\\">Techstack: UX | HTML5 | CSS3 | JavaScript</div>"}},{"node":{"frontmatter":{"title":"Website Küchenstudio"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto; max-width: 800px; \\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 50%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"alte Website für ein Küchenstudio\\"\\n        title=\\"alte Website für ein Küchenstudio\\"\\n        src=\\"/static/3af297eb51d7a4522d680b66004f2b5b/4b190/WebsiteMockup_Kuechenexkl.jpg\\"\\n        srcset=\\"/static/3af297eb51d7a4522d680b66004f2b5b/e07e9/WebsiteMockup_Kuechenexkl.jpg 200w,\\n/static/3af297eb51d7a4522d680b66004f2b5b/066f9/WebsiteMockup_Kuechenexkl.jpg 400w,\\n/static/3af297eb51d7a4522d680b66004f2b5b/4b190/WebsiteMockup_Kuechenexkl.jpg 800w\\"\\n        sizes=\\"(max-width: 800px) 100vw, 800px\\"\\n        style=\\"width:100%;height:100%;margin:0;vertical-align:middle;position:absolute;top:0;left:0;\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<p>Eine ältere Website für ein Küchenstudio bei der es zu Anfang darauf ankam, sich selbst zu mit den Herstellern zu präsentieren und ein paar seiner eigenen Projekte zu zeigen. Dafür rutschte die übliche Slideshow eine Stufe nach unten und das Logo mit den Marken nach oben in den Fokus. Später kamen noch eigene Videos hinzu, die auch noch eingebunden wurden. Die Projekte wurden als Grid angelegt und man konnte mit einem Klick Modalboxen öffnen, die genauere Beschreibungen enthielten.</p>\\n<p>Die Seite wurde als eine Art \\"Visitenkarte\\" angelegt, da keine Inhalte selber eingestellt werden sollten, also musste ein CMS, wie Joomla!, dafür nicht eingerichtet werden.</p>\\n<div style=\\"text-align: right\\">Techstack: HTML5 | CSS3 | JavaScript</div>"}}]}}}')},RTHJ:function(A,e,n){A.exports={projects:"projects-module--projects--1Su_P"}}}]);
